import React from "react";
import WithCard from "components/container/withCard";
import { getSavedUsers } from "api/db-init";

type Props = {
  // using `interface` is also ok
  env: string;
};
type State = {
  users: Array; // like this
};

export default class Saved extends React.Component<Props, State> {
  componentDidMount() {
    const users = getSavedUsers();
    this.setState(users);
  }
  render() {
    return <WithCard />;
  }
}
